import React,{useEffect,useState} from 'react'
import './ListEmployee.css'
import Employee from '../Employee/Employee'
import axios from 'axios'

const ListEmployee = () => {
  const [data,setData] = useState([])
  const fetchdata = async()=>{
      const response = await axios.get("http://localhost:4000/employee/")
      if(response.data.success){
        setData(response.data.data.reverse())
        console.log(response.data.data)
      }

  }

  useEffect(()=>{
    fetchdata()
  },[])
  return (
    <div className='list-employee'>
      {
        data.map((item,index)=>{
          return(
            <Employee name={item.name} age={item.age} birthday={item.birthday} email={item.email} address={item.address} phonenumber={item.phonenumber} qualification={item.qualification} passport={item.passport} citizen={item.citizen} religion={item.religion} videolink={item.videolink} />
          )
        })
      }
    </div>
  )
}

export default ListEmployee
